INSERT INTO `email` VALUES (1,41,'Third Floor Party','The party this week was amazing! That\'s all.','2020-08-06'),(2,41,'Next Week\'s Party','I won\'t be able to make it next week. So, have fun without me!','2020-09-10'),(3,35,'New trees!','We just received new trees, and we\'re looking for help planting them. Email me if you\'re interested.','2020-09-13'),(4,36,'First Lesson','We\'ll be starting with some simple breathing exercises  this Tuesday, so don\'t miss it!','2020-09-20'),(5,34,'Welcome!','For too long have pets been banned from our fair condominium. But now, we shall fight until all adorable critters are allowed in these fair halls! ','2020-10-01'),(6,1,'Condo Meeting','Please note, that next week we will be having a meeting to discuss upcoming changes to our condo in the near future. Though we don\'t have a conclusive date, please be sure to have ample time available so you can make it. ','2020-10-13'),(7,44,'Ideas for Events','The other floors have all sorts of events, but I have no idea what we should do. If you have any ideas, feel free to talk to me. ','2020-10-14'),(8,47,'Condo Cleaning','There\'s been leaks all over the halls, and no one has cleaned it. Are there any janitors in this building??? ','2020-10-17'),(9,32,'Cleaning',' Hello we need help cleaning','2020-10-30'),(10,1,'Renovations','We will be repairing all the windows on the first floor next week, so be sure to say when you are available. ','2020-11-11'),(11,1,'Condo Fees','Please pay your fees or else you\'ll be evicted!','2020-11-30'),(12,47,'RE:Condo Fees',' Yes','2020-12-01'),(13,29,'Loud Noise','Hey! You\'ve been blasting music for the past five nights! I\'d like to sleep, thank you!','2020-12-12'),(14,28,'RE:Loud Noises','It\'s the only time I can listen to it, so no.','2020-12-12'),(15,29,'Hang Out','Wanna hang out some time?','2020-12-12');
